  \"2016-07-27T23:03:55.402890\",\n\t\"name\": \"environmental-assessment-dakota-tallgrass-prairie-wildlife-management-area-grassland-easem\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service (the
  Service) proposes to create the Dakota Tallgrass Prairie Wildlife Management Area
  (WMA) to preserve 185,000 acres of native tallgrass prairie in eastern North and
  South Dakota. Prairie will be preserved primarily through the purchase of perpetual
  grassland easements from willing sellers. This EA includes the purpose and need
  for action, alternatives, a description of the affected environment, a summary of
  environmental consequences, and an environmental review.\",\n\t\"license_title\":
